import "./about.css";

export default function About() {
  return (
    <div className="about">
      <img className="https://images.pexels.com/photos/6707376/pexels-photo-6707376.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260" />
      <div className="aboutText">
        <h1> About this blog </h1>
      </div>
    </div>
  );
}
